import React from "react";

const Newsletter = () => {
  return (
    <div className="text-white grid lg:grid-cols-2 w-full py-24 px-4 text-left max-w-[1240px] md:mx-auto md:py-20 lg:py-15">
      <div>
        <h1 className="text-3xl font-bold pb-2">
          Want tips & tricks to optimize
        </h1>
        <p>Sign up to our newsletter and styp up to date.</p>
      </div>

      <div className="flex flex-col">
        <input
          className="mt-10 p-2 rounded-md w-full md:w-[40%]"
          placeholder="Enter Your Email"
          type={"email"}
        />
        <button className="bg-[#00df91] w-[200px] rounded text-black font-medium  my-6 p-3 mx-auto inline">
          Get Started
        </button>
        <p>We care about the protection of your data. Read our Shit</p>
      </div>
    </div>
  );
};

export default Newsletter;
